import zIndex from '@material-ui/core/styles/zIndex'
import {makeStyles} from '@material-ui/styles'

const useStyles = makeStyles((theme)=>({
   box:{
      position:'relative',
      height:'800px',
      width:'100%',
      overFlow:'hidden',
      zIndex:'1'
   },

   video:{
       width:"100%",
       height:'100%',
       objectFit:'cover',
    zIndex:'-1'
   },

}))

export default useStyles
